import { TProp } from "~/interfaces/material_components";
import { ButtonProps, PropProperty } from "./interface";

const hoges: Record<ButtonProps, PropProperty> = {
  children: {
    value: "ボタン",
    default: "ボタン",
    description: "The content of the button."
  },
  classes: {
    value: "",
    default: null,
    description: ""
  },
  // color: {
  //   value: 'default',
  //   default: 'default',
  //
  // }
};

const props: TProp[] = [
  {
    name: "children",
    default: null
  },
  {
    name: "classes",
    default: null
  },
  {
    name: "color",
    default: "default"
  },
  {
    name: "component",
    default: "button"
  },
  {
    name: "disabled",
    default: false
  },
  {
    name: "disableElevation",
    default: false
  },
  {
    name: "disableFocusRipple",
    default: false
  },
  {
    name: "disableRipple",
    default: null
  },
  {
    name: "endIcon",
    default: null
  },
  {
    name: "fullWidth",
    default: false
  },
  {
    name: "href",
    default: null
  },
  {
    name: "size",
    default: "medium"
  },
  {
    name: "startIcon",
    default: null
  },
  {
    name: "variant",
    default: "contained"
  }
];

export default props;
